import random
import numpy as np

class Node:
    def __init__(self, state, parent=None):
        self.state = state
        self.parent = parent
        self.children = []
        self.visits = 0
        self.wins = 0

class MCTS:
    def __init__(self, game):
        self.game = game
        self.root = Node(game.initial_state())

    def search(self, iterations):
        for _ in range(iterations):
            node = self.select()
            if node.state.is_terminal():
                self.backpropagate(node, node.state.winner())
            else:
                actions = node.state.legal_actions()
                new_node = self.expand(node, random.choice(actions))
                self.simulate(new_node)
                self.backpropagate(new_node, new_node.state.winner())

    def select(self):
        node = self.root
        while not node.state.is_terminal():
            if node.children:
                node = self.best_child(node)
            else:
                return self.expand(node, random.choice(node.state.legal_actions()))
        return node

    def best_child(self, node):
        return max(node.children, key=lambda child: child.wins / child.visits)

    def expand(self, node, action):
        new_state = node.state.apply_action(action)
        new_node = Node(new_state, node)
        node.children.append(new_node)
        return new_node

    def simulate(self, node):
        state = node.state
        while not state.is_terminal():
            state = state.apply_action(random.choice(state.legal_actions()))
        return state.winner()

    def backpropagate(self, node, winner):
        while node is not None:
            node.visits += 1
            if winner == node.state.player:
                node.wins += 1
            node = node.parent

